import React from "react";
import { Fragment } from "react/cjs/react.production.min";
import './method.css';

const Method=()=>{
const ContactMethodData=[
    {
        name:"call",
        method:"Call me",
        address:"8423364688"
    },
    {
        name:"email",
        method:"Email",
        address:"priyanshg615@gmail.com"
    },
    {
        name:"location",
        method:"Location",
        address:"Kanpur,Uttar Pradesh"
    },
];

return(
    <Fragment>
        <div className="method">
            <span className="icon"><ion-icon name="call"></ion-icon></span>
            <div className="details">
                <h3 className="name">Call</h3>
                <p className="address">8423364688</p>
            </div>
        </div>
    </Fragment>
);
};

export default Method;
